import "./Cadastros.css";
import axios from "axios";
import { useState, useEffect } from "react";

function Cadastros() {
    const [clientes, setClientes] = useState([]);
    const [animais, setAnimais] = useState([]);
    const [produtos, setProdutos] = useState([]);

    useEffect(() => {
        getClientes();
        getAnimais();
        getProdutos();
    }, []);

    function getClientes() {
        axios.get("http://localhost:5119/api/pessoas")
            .then((resposta) => {
                setClientes(resposta.data);
            })
            .catch((erro) => {
                console.error("Erro ao buscar clientes:", erro);
            });
    }

    function getAnimais() {
        axios.get("http://localhost:5119/api/animais")
            .then((resposta) => {
                setAnimais(resposta.data);
            })
            .catch((erro) => {
                console.error("Erro ao buscar animais:", erro);
            });
    }

    function getProdutos() {
        axios.get("http://localhost:5119/api/produtos")
            .then((resposta) => {
                setProdutos(resposta.data);
            })
            .catch((erro) => {
                console.error("Erro ao buscar produtos:", erro);
            });
    }

    return (
        <div>
            <h1>Cadastro de Clientes</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Telefone</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {clientes.map((cliente) => (
                        <tr key={cliente.id}>
                            <td>{cliente.id}</td>
                            <td>{cliente.nome}</td>
                            <td>{cliente.telefone}</td>
                            <td>{cliente.email}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h1>Cadastro de Animais</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Raça</th>
                        <th>Porte</th>
                    </tr>
                </thead>
                <tbody>
                    {animais.map((animal) => (
                        <tr key={animal.id}>
                            <td>{animal.id}</td>
                            <td>{animal.nomeAnimal}</td>
                            <td>{animal.raca}</td>
                            <td>{animal.porte}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h1>Cadastro de Produtos</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Descrição</th>
                        <th>Preço</th>
                    </tr>
                </thead>
                <tbody>
                    {produtos.map((produto) => (
                        <tr key={produto.id}>
                            <td>{produto.id}</td>
                            <td>{produto.nomeProduto}</td>
                            <td>{produto.descricao}</td>
                            <td>{produto.preco}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Cadastros;
